import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './App.css';
import Navbar from "./components/Navbar/Navbar";

function App() {
  return (
    <Fragment>
      <Navbar/>
    </Fragment>
  );
}

function login() {
  return (
    <div>
      <input type="text"placeholder="username" />
      <input type="text"placeholder="password"/>
      <button>Login</button>
    </div>
  )
}

export default App;
